import styled from 'styled-components';
import "../styles.css";

import { FaInstagram } from "react-icons/fa";



class Rodape extends React.Component {
    render(){
        return (

    
        <footer className="app-footer">
            <FaInstagram/>

        
                VicarFood
           
        </footer>
    
        );
    }
}

export default Rodape;
